import React from 'react';
import PropTypes from 'prop-types';
import styles from './Navbar.module.css';

function Navbar() {
  return (
    <div>
      <Link to="/">Home </Link>
      <Link to="/about">About Us </Link>
      <Link to="/shop">Shop Now </Link>
    </div>
  );
};

export default Navbar;
